INSERT INTO GUIDE_STEP_LANGUAGES VALUES (1,1,'PraËka se suöiËkou','Jestliûe si po¯ÌdÌte praËku se suöiËkou, m˘ûete zapomenout na zdlouhavÈ suöenÌ pr·dla venku nebo v bytÏ. U spousty druh˘ pr·dla lze upustit od neoblÌbenÈho ûehlenÌ ñ pr·dlo po vysuöenÌ nenÌ zmaËkanÈ, volitelnÈ parnÌ programy jej navÌc zanechajÌ perfektnÏ nad˝chanÈ a voÚavÈ. PraËky se suöiËkou jsou ide·lnÌ nejen do menöÌch prostor, kde uöet¯Ì mÌsto. A na co se p¯i v˝bÏru zamÏ¯it? V˝hody a nev˝hody suöiËek pr·dla\r\nPokud p¯em˝ölÌte nad tÌm, zdali vybrat suöiËku jako samostatn˝ spot¯ebiË, nebo zvolit automatickou praËku se suöiËkou, podÌvejte se nejprve na v˝hody a nev˝hody samostatn˝ch suöiËek nÌûe:'),(2,1,'VolnÏ stojÌcÌ, nebo vestavn·?','Vestavnou praËku ocenÌte v p¯ÌpadÏ, kdyû se p¯Ìstroj nevejde do koupelny nebo technickÈ mÌstnosti. M˘ûete pro ni najÌt mÌsto t¯eba v kuchyni a dÌky jednotnosti dvÌ¯ek nemusÌ nikdo vÏdÏt, ûe ji tam m·te a pokud zvolÌte tichou, pak ani nemusÌ zaznamenat, ûe pr·vÏ perete. I p¯es zabudov·nÌ do kuchyÚskÈ linky je p¯Ìstup k praËce bezproblÈmov˝, s ˙chyty pro dvÌ¯ka p¯Ìmo na spot¯ebiËi se zde poËÌt·. V˝hodou vestavn˝ch praËek je nen·padnost, nev˝hodou zas omezen˝ v˝bÏr a vyööÌ cena. Mnohem vÏtöÌ v˝bÏr pak budete mÌt u volnÏ stojÌcÌch praËek. Ty se pak dÏlÌ na ty s hornÌm plnÏnÌm a s p¯ednÌm (boËnÌm) plnÏnÌm. '),(3,1,'Plnit p¯edem, nebo vrchem?','PraËky plnÏnÈ p¯edem jsou nejrozöÌ¯enÏjöÌ variantou, jejich z·sadnÌ v˝hodou je obrovsk· variabilita, a to nejenom funkËnÌ, ale i rozmÏrov·. Od hloubky pouh˝ch 33 centimetr˘ s kapacitou sluön˝ch 5 kg, aû po praËky dvojn·sob hlubokÈ, schopnÈ pojmou p¯es 10 kg pr·dla. CenovÏ m˘ûete koupit praËku za 5 000 KË, ale taktÈû model, jenû stojÌ vÌce neû 60 000 KË. FunkËnÏ i zpracov·nÌm m·me co do ËinÏnÌ se zcela odliön˝mi produkty. V neposlednÌ ¯adÏ si lze v omezenÈ mÌ¯e vybrat i barevnou variantu. Pokud nechcete praËku bÌlou, lze zakoupit modely st¯ÌbrnÈ a ËernÈ, potkat ale m˘ûete i odv·ûnÏjöÌ odstÌny. Na barevnÈ kreace u praËek se specializuje hlavnÏ firma LG.Vrchem plnÏnÈ praËky jsou praktickÈ hlavnÏ proto, ûe p¯ed sebou nepot¯ebujÌ û·dnÈ mÌsto nutnÈ pro otev¯enÌ dvÌ¯ek bubnu, ËÌmû se perfektnÏ hodÌ hlavnÏ do menöÌch byt˘ Ëi garsonek. Na trhu je jich podstatnÏ mÈnÏ neû p¯edem plnÏn˝ch variant, nicmÈnÏ i v tomto produktovÈm segmentu si lze vybrat modely za velice p¯ÌznivÈ ceny. NenÌ tak problÈm zakoupit praËku do 6 000 KË, nejvyööÌ modely se opÏt prod·vajÌ v cen·ch nÏkolika desÌtek tisÌc korun. U vrchem plnÏn˝ch praËek nenajdete p¯Ìliö technick˝ch vychyt·vek, p¯esto lze zakoupit jak z·kladnÌ modely, kde si uûivatel manu·lnÏ volÌ program Ëi teplotu, tak i typy, kterÈ po zvolenÌ programu vöe nastavÌ samy, disponujÌ podsvÌcen˝mi informaËnÌmi displeji, umoûÚujÌ volit dÈlku programu apod.');
